from collections import deque
s = ""


long_string = ''
long_size = 0

for i in range(len(s)):
    for j in range(i,len(s)):
        d = deque(s[i:j+1])
        accept = True
        while(True):
            try:
                first,end = d.popleft(),d.pop()
                if first != end:
                    accept = False
                    break
            except:
                break
        if accept and (j-i+1)>long_size:
            long_size = j-i+1
            long_string = s[i:j+1]

print(long_string)